window.bookSummaryJSON = "<p>What really happened to TWA 800? On the 20th anniversary of the crash, author Jack Cashill reveals shocking new evidence. </p> <p>TWA Flight 800 crashed into the Atlantic shortly after takeoff from JFK Airport on July 17, 1996, killing all 230 passengers onboard. Although initial reports suggested a terrorist attack, FBI and NTSB investigators blamed a fuel-tank explosion. But skeptics have long questioned the official story, and new evidence has surfaced that suggests a widespread conspiracy. </p> <p>In <i>TWA 800</i>, historian Jack Cashill introduces new documents and testimonies that reveal the shocking true chain of events, from the disastrous crash to the high-level decision to create a cover story and the attempts to silence anyone who dared speak the truth. </p>"; 
